executeFunc((function manufactureApplicationFilter(){if(typeof formDebounce!=="function"){return false}const form=document.forms.manufacture_application_filter_form;if(typeof form==="undefined"){return false}form.addEventListener("click",(()=>{if(idFormDebounce==lastFormDebounce){clearTimeout(lastFormDebounce)}lastFormDebounce=idFormDebounce}));const inputFields=form.querySelectorAll("input, select, textarea");inputFields.forEach((field=>{if(field.id==="manufacture_application_filter_form_status"){field.addEventListener("change",(()=>{setTimeout((()=>{form.submit()}),300)}));return}field.addEventListener("change",formDebounce((()=>{form.submit()}),1500))}));return true}));